import * as React from "react";
import classNames from "classnames";
import { useTheme } from "next-themes";

import { Block, InlineText } from "~/components/primitive";
import { useDidMount, useDocumentTitle } from "~/hooks";
import type { T_ReactChildren, T_ReactElement } from "~/types";

function MariaCamila(): T_ReactElement {
	// hooks
	const { theme, setTheme } = useTheme();

	// effects
	useDidMount(() => {
		if (theme === "dark") setTheme("light");
	});

	useDocumentTitle("Feliz cumple!!");

	return (
		<Block className="tw-mx-auto tw-max-w-lg tw-p-6">
			<Title className="tw-mb-12">
				🎉
				<br />
				Feliz cumpleaños!
				<br />
				Maria Camila
				<br />
				👩‍⚕️
			</Title>

			<Text
				emoji="🤓"
				left
			>
				Se que es lo <Marked>mismo</Marked> del año pasado
			</Text>

			<Text emoji="🙁">
				Pero hay que <Marked>re-usar</Marked> las cosas y cuidar al planeta
			</Text>

			<Text
				emoji="👧"
				left
			>
				Ya no eres una <Marked>bichota</Marked>
			</Text>

			<Text emoji="👸">
				Eres toda una <Marked>Scarlet Linares!</Marked>
			</Text>

			<Block className="tw-my-8">
				<Image />
			</Block>

			<hr className="tw-mt-10 tw-h-px tw-border tw-border-dashed tw-border-blue-600 tw-opacity-50 tw-shadow-md" />

			<Block className="tw-my-8">
				<iframe
					src="https://www.youtube.com/embed/57KDWLTDTuo"
					height="315"
					width="100%"
					allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
					frameBorder="0"
					loading="lazy"
					title="YouTube video player"
					allowFullScreen
				/>
				<Title className="tw-mt-4">Exitos en esta nueva etapa de tu vida ✌️</Title>
			</Block>

			<style jsx>
				{`
					:global(body) {
						@apply tw-bg-blue-300;
					}
				`}
			</style>
		</Block>
	);
}

export default MariaCamila;

// --- Components ---

function Text({
	children,
	emoji,
	left = false,
}: {
	children: T_ReactChildren;
	emoji: string;
	left?: boolean;
}): T_ReactElement {
	return (
		<Block
			className={classNames(
				"tw-my-6 tw-flex tw-items-center tw-text-lg",
				left ? "tw-pr-10 tw-text-left" : "tw-flex-row-reverse tw-pl-10 tw-text-right",
			)}
		>
			<InlineText className="tw-flex-shrink-0 tw-text-3xl">{emoji}</InlineText>
			<InlineText className="tw-mx-3">{children}</InlineText>
		</Block>
	);
}

function Marked({ children }: { children: T_ReactChildren }): T_ReactElement {
	return (
		<u>
			<b>{children}</b>
		</u>
	);
}

function Title({
	children,
	className,
}: {
	children: T_ReactChildren;
	className: string;
}): T_ReactElement {
	return (
		<h1 className={classNames("tw-text-center tw-text-3xl tw-font-bold", className)}>{children}</h1>
	);
}

function Image(): T_ReactElement {
	return (
		<img
			className="tw-rounded-tr-md tw-rounded-bl-md tw-border-8 tw-shadow-md dfr-border-color-gs-black"
			alt="Foto"
			src="data:image/png;base64,"
		/>
	);
}
